cordova.define("com.jiedaibao.h5share.H5Share", function (require, exports, module) {
   var exec = require('cordova/exec');
   module.exports = {
       h5Share : function(content, shareTo, successCallback, errorCallback) {
       exec(
            successCallback,
            errorCallback,
            'H5Share',
            'h5Share',
            [{
                "content": content,
                "shareTo": shareTo
             }]
            );
       }
    }
  }
);
